import React from "react";

import Card from "./Components/Card";
import Ldata from "./Components/Ldata";
function App() {
    return (
        <>
            <div className="cards">


                {
                    Ldata.map(cvalue => {
                        <Card images={cvalue.img} title={cvalue.title} type={cvalue.type} />
                    })
                }
            </div>
        </>
    )
};


export default App;
